char* DebenuPDFLibraryDLL1114::StringParm(const CString& strParm, int& sb)
{
#ifdef UNICODE
	sb = 1;
	CStringA ansiParm(strParm, strParm.GetLength());
	int pl = ansiParm.GetLength();
	char* sp = DebenuPDFLibraryCreateBuffer(instanceID, pl);
	DebenuPDFLibraryAddToBuffer(instanceID, sp, const_cast<char *>((LPCSTR)ansiParm), pl);
	return sp;
#else
	if (strParm.Find("\0") < 0)
	{
		sb = 0;
		return const_cast<char *>((LPCSTR)strParm);
	}
	else
	{
		sb = 1;
		int pl = strParm.GetLength();
		char* sp = DebenuPDFLibraryCreateBuffer(instanceID, pl);
		DebenuPDFLibraryAddToBuffer(instanceID, sp, const_cast<char *>((LPCSTR)strParm), pl);
		return sp;
	}
#endif
}

char* DebenuPDFLibraryDLL1114::StringParmUtf8(const CString& strParm, int& sb)
{
#ifdef UNICODE
	sb = 1;
	LPCWSTR source = strParm;
	int sourceLen = strParm.GetLength();
	int pl = WideCharToMultiByte(CP_UTF8, 0, source, sourceLen, NULL, 0, NULL, NULL);
	CStringA utf8Parm;
	WideCharToMultiByte(CP_UTF8, 0, source, sourceLen, utf8Parm.GetBuffer(pl), pl, NULL, NULL);
	utf8Parm.ReleaseBuffer();
	char* sp = DebenuPDFLibraryCreateBuffer(instanceID, pl);
	DebenuPDFLibraryAddToBuffer(instanceID, sp, const_cast<char *>((LPCSTR)utf8Parm), pl);
	return sp;
#else
	return StringParm(strParm, sb);
#endif
}

void DebenuPDFLibraryDLL1114::Utf8Result(char* utf8String, int utf8Length, CString& output)
{
#ifdef UNICODE
	int charCount = MultiByteToWideChar(CP_UTF8, 0, utf8String, utf8Length, NULL, 0);
	MultiByteToWideChar(CP_UTF8, 0, utf8String, utf8Length, output.GetBuffer(charCount), charCount);
	output.ReleaseBuffer();
#else
	CStringW uBuffer;
	int charCount = MultiByteToWideChar(CP_UTF8, 0, utf8String, utf8Length, NULL, 0);
	MultiByteToWideChar(CP_UTF8, 0, utf8String, utf8Length, uBuffer.GetBuffer(charCount), charCount);
	uBuffer.ReleaseBuffer();
	output = uBuffer;
#endif
}

